script: |
  super -f text -I q9993.spq | sort > q9993.out

inputs:
  - name: q9993.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE col2 + ( + col1 ) NOT BETWEEN - 23 * - 55 AND + + col2 / col0 * + + col1 * + col0 / - 75 - CAST ( NULL AS INTEGER ) * - + col2;
  - name: tab1

outputs:
  - name: q9993.out
    data: |
      51	14	96
      85	5	59
      91	47	68
